import React from "react";

function App() {
  return (
    <React.Fragment>
      <span
        style={{ fontFamily: "Unna", fontStyle: "Bold 700", fontSize: 100 }}
      >
        looking
      </span>
      <span
        style={{
          fontFamily: "Unna",
          fontStyle: "ital",
          fontSize: 100,
        }}
      >
        for
      </span>
    </React.Fragment>
  );
}

export default App;
